import styled from "styled-components";
import { StyledDiv } from "../StyledDiv/StyledDiv";


export const StyledFormContainer = styled(StyledDiv).form`
display: flex;
margin: auto;
width: 20%;
flex-direction: column;
position: relative;
top: 400px;
gap: 16px;
align-items: center;

div{
    display: flex;
    width: 300px;
    justify-content: space-between;
}

button{
    margin-top: 16px;
    width: 30%;
}
`
